var searchParams= new URLSearchParams(window.location.search)
var teamId=(searchParams.get("p"))
console.log(teamId)
var actualTeamId= teamId-1;
console.log(actualTeamId)

var mainHeading= document.getElementById("main-heading")
mainHeading.innerHTML= teams[actualTeamId].name
var playerImage= document.getElementById("front-poster-pic")
playerImage.src=teams[actualTeamId].teamIcon
var playersDetails= document.getElementById("player-details")
playersDetails.innerHTML= teams[actualTeamId].playerCount
var batsmanDetails= document.getElementById("batsman-details")
batsmanDetails.innerHTML= teams[actualTeamId].batsman
var bowlerDetails= document.getElementById("bowler-details")
bowlerDetails.innerHTML= teams[actualTeamId].bowler
var wonDetails= document.getElementById("won-details")
wonDetails.innerHTML=teams[actualTeamId].championshipWon

